import './App.css';


const App = () => {

  useEffect(() => {
    axios.get('https://us.battle.net/oauth/token', {
      params: {
        client_id: CLIENT_ID,
        client_secret: CLIENT_SECRET,
        grant_type: "client_credentials",
      }
    })
      .then(function(response) {
        console.log(response);
      })
      .catch(function(error) {
        console.log(error);
      })
  }, []);






  return (
    <div className="App">
      <button>
        Click Me
      </button>
      {/* {token} */}
    </div>
  );
};

export default App;
